/* eslint-disable react/no-unescaped-entities */
import React from 'react';
import { Typeahead, Paper } from '@../../../../reactify/build';
import {
  declarativeCode,
  simpleCode,
} from './code-refrence';
import './typeahead.scss';
import DemoCard from '../../components/demo-card';

const suggestions = [
  {
    index: 1,
    value: 'value 1',
  },
  {
    index: 2,
    value: 'value 2',
  },
  {
    index: 3,
    value: 'value 3',
  },
];

const PaginatorDemo = () => (
  <div>
    <DemoCard
      title="Simple Use"
      uniqueIdentifier="simpleUse"
      sourceCode={simpleCode}
    >
      <Typeahead suggestions={suggestions} />
    </DemoCard>

    <DemoCard
      title="Declarative"
      uniqueIdentifier="declarativeUse"
      sourceCode={declarativeCode}
    >
      <Typeahead>
        <Typeahead.Suggestion
          index={1}
          value="value 1"
        >
          <Paper>VALUE 1</Paper>
        </Typeahead.Suggestion>
        <Typeahead.Suggestion
          index={2}
          value="value 2"
        >
          <Paper>VALUE 2</Paper>
        </Typeahead.Suggestion>
        <Typeahead.Suggestion
          index={3}
          value="value 3"
        >
          <Paper>VALUE 3</Paper>
        </Typeahead.Suggestion>
      </Typeahead>
    </DemoCard>

    <DemoCard
      title="Simple Use"
      uniqueIdentifier="simpleUse"
      sourceCode={eventsCode}
    >
      <Typeahead suggestions={suggestions} onChange={(...args) => console.log(...args)} />
    </DemoCard>
  </div>
);

export default PaginatorDemo;
